function normalizarMarca(marca) {
    if (!marca || marca.trim() === '') return 'MARCA_DESCONOCIDA';

    const marcaUpper = marca.toUpperCase().trim();

    // Buscar en el diccionario
    for (const [canonical, variations] of Object.entries(MARCAS_CANONICAS)) {
        if (variations.some(v => marcaUpper === v || marcaUpper.includes(v))) {
            return canonical;
        }
    }

    return marcaUpper;
}

function normalizarTexto(texto) {
    if (!texto || texto.trim() === '') return '';

    return texto
        .toUpperCase()
        .trim()
        .replace(/\s+/g, ' ')
        .replace(/[^\w\s\-]/g, '')
        .trim();
}

// FUNCIÃ“N CRÃTICA: Extraer y normalizar versiÃ³n
function extraerVersionReal(versionCorta) {
