        { buscar: /\bBLACK LABEL\b/g, reemplazar: 'BLACK-LABEL' },
        { buscar: /\bGRAND TOURING\b/g, reemplazar: 'GRAND-TOURING' },
        { buscar: /\bJOHN COOPER WORKS\b/g, reemplazar: 'JOHN-COOPER-WORKS' },
        { buscar: /\bLAUNCH EDITION\b/g, reemplazar: 'LAUNCH-EDITION' },
        { buscar: /\bFIRST EDITION\b/g, reemplazar: 'FIRST-EDITION' },
        { buscar: /\bSPECIAL EDITION\b/g, reemplazar: 'SPECIAL-EDITION' },
        { buscar: /\bSPECIAL ED\b/g, reemplazar: 'SPECIAL-EDITION' },
        { buscar: /\bLIMITED EDITION\b/g, reemplazar: 'LIMITED-EDITION' },
        { buscar: /\bR DYNAMIC\b/g, reemplazar: 'R-DYNAMIC' },
        { buscar: /\bR-DYNAMIC\b/g, reemplazar: 'R-DYNAMIC' },
        { buscar: /\b30 A[Ã‘N]OS\b/g, reemplazar: '30-AÃ‘OS' },
