        { buscar: /\bS LINE PLUS\b/g, reemplazar: 'S-LINE-PLUS' },
        { buscar: /\bS-LINE PLUS\b/g, reemplazar: 'S-LINE-PLUS' }
    ];

    // Aplicar normalizaciones
    for (let norm of normalizaciones) {
        desc = desc.replace(norm.buscar, norm.reemplazar);
    }

    // SEGUNDO: Remover informaciÃ³n tÃ©cnica
    const infoTecnica = [
        /\bAUT\b/g,            // AUT
