        /\b\d+\.\d+L?\b/g,     // 1.4, 2.0L, 3.2L
        /\bL\d+\b/g,           // L4, L6
        /\b4X4\b/g,            // 4X4
        /\b4X2\b/g,            // 4X2
        /\b4WD\b/g,            // 4WD
        /\bAWD\b/g,            // AWD
