        /\bMILD HYBRID\b/g     // MILD HYBRID
    ];

    // Limpiar informaciÃ³n tÃ©cnica
    let limpio = desc;
    for (let pattern of infoTecnica) {
        limpio = limpio.replace(pattern, ' ');
    }

    // Limpiar espacios mÃºltiples
    limpio = limpio.replace(/\s+/g, ' ').trim();

    // Si despuÃ©s de limpiar queda algo significativo, retornarlo
    if (limpio && limpio.length > 1) {
        // Verificar si es una versiÃ³n conocida que ya normalizamos
        const versionesNormalizadas = [
            'A-SPEC', 'TYPE-S', 'TYPE-R', 'S-LINE', 'S-LINE-PLUS', 
            'RS-LINE', 'R-LINE', 'AMG-LINE', 'M-SPORT', 'M-PERFORMANCE',
            'BLACK-LABEL', 'GRAND-TOURING', 'JOHN-COOPER-WORKS',
            'LAUNCH-EDITION', 'FIRST-EDITION', 'SPECIAL-EDITION',
            'LIMITED-EDITION', 'R-DYNAMIC', '30-AÃ‘OS', '10-ANIVERSARIO'
        ];

        // Si encontramos una versiÃ³n normalizada, retornarla
        for (let version of versionesNormalizadas) {
            if (limpio.includes(version)) {
                return version;
            }
        }

        // Buscar versiones simples conocidas
        const versionesSimples = [
            'RS', 'SPORT', 'ELITE', 'LUXURY', 'PREMIUM', 'EXCLUSIVE',
            'ATTRACTION', 'AMBIENTE', 'AMBITION', 'ADVANCE', 'TECH',
