            'CABRIOLET', 'AVANT', 'ALLROAD', 'BASEBALL', 'FRONT'
        ];

        for (let version of versionesSimples) {
            if (limpio === version || limpio.startsWith(version + ' ')) {
                return version;
            }
        }

        // Si queda algo despuÃ©s de limpiar, tomar la primera palabra
        const palabras = limpio.split(' ').filter(p => p.length > 1);
        if (palabras.length > 0) {
            return palabras[0];
        }
    }

    return 'STANDARD';
}

// FunciÃ³n para normalizar transmisiÃ³n
function normalizarTransmision(transmisionDesc, transmisionCodigo, versionCompleta, versionCorta) {
    // Primero intentar con el cÃ³digo si es confiable
    if (transmisionCodigo === 1) return 'MANUAL';
    if (transmisionCodigo === 2) return 'AUTO';

    // Si hay descripciÃ³n vÃ¡lida
    if (transmisionDesc && transmisionDesc !== 'No especificada') {
        return MAPA_TRANSMISIONES[transmisionDesc] || 'NO_ESPECIFICADA';
    }

    // Intentar detectar desde las descripciones
    const textoCompleto = `${versionCompleta || ''} ${versionCorta || ''}`.toUpperCase();

    // Patrones de transmisiÃ³n manual
    if (textoCompleto.match(/\b(STD|TM|MT|MANUAL|MAN)\b/) && 
        !textoCompleto.match(/\b(AUT|AUTO|TA|AT|CVT|DCT|DSG|STRONIC|TIPTRONIC|MULTITRONIC)\b/)) {
        return 'MANUAL';
    }

    // Patrones de transmisiÃ³n automÃ¡tica
    if (textoCompleto.match(/\b(AUT|AUTO|TA|AT|CVT|DCT|DSG|TIPTRONIC|STRONIC|MULTITRONIC)\b/)) {
        return 'AUTO';
    }

    return 'NO_ESPECIFICADA';
}

// FunciÃ³n para generar hash Ãºnico
function generarHash(...componentes) {
    const textoHash = componentes
        .map(c => String(c || '').toUpperCase().trim())
        .filter(c => c !== '')
        .join('|');

    if (textoHash === '') {
        return crypto
            .createHash('sha256')
            .update(`EMPTY_${Date.now()}_${Math.random()}`, 'utf8')
            .digest('hex');
    }

    return crypto
        .createHash('sha256')
        .update(textoHash, 'utf8')
        .digest('hex');
}

